import React from "react";
import { Link } from "react-router-dom";
function NotFound(){

    return (
      <div>
        <ul>
          <li>
            <Link to="/*">Home</Link>
          </li>

          <li>
            <Link to="/Home">Add Bug</Link>
          </li>
        </ul>
        <h2>Not Found</h2>
      </div>
    );
}

export default NotFound;
